import React from 'react';

function MessageInput(props) {
  return (
    <div className="chat-message-input">
      <input type = "text" 
      name = "message-input" 
      id = "message-input"
      value = {props.MessageInput} />
      <h4>MessageInput: {props.username}</h4>
    </div>
  );
}

export default MessageInput;
